import Image from './Image/index';
import Info from './Info/index';

const Member = (name, imageUrl) => {

    return (
        <div className="d-inline col-lg-4 col-md-6 align-items-stretch">
            <div className="member">
                <Image />
                <Info />
            </div>
        </div >
    )
}

export default Member;
